Les présentes données comprennent l’ensemble des digues de protection contre les inondations et les submersions classées par arrêté préfectoral au titre du décret 2007-1735 du 11 décembre 2007 relatif à la sécurité des ouvrages hydrauliques.
Ce décret répartit les ouvrages en 4 classes : A,B,C,D, en fonction de la hauteur de l’ouvrage et de la population protégée :
A : population protégée supérieure à 50 000 et hauteur de l’ouvrage supérieure à 1m ;
B : population protégée comprise entre 1 000 et 50 000 et hauteur de l’ouvrage supérieure à 1m ;
C : population protégée comprise entre 10 et 1 000 et hauteur de l’ouvrage supérieure à 1m ;
D : population protégée inférieure à 10 ou/et hauteur de l’ouvrage inférieure à 1 m.  ....

Les données mises à disposition sont les informations extraites du système d’information « Prix Carburants ». Ces données concernent les points de ventes ouverts référencés sur le site https://www.prix-carburants.gouv.fr (Arrêté ministériel du 12 décembre 2006).

Les données disponibles comprennent :

Les informations générales sur le point de vente : adresse, coordonnées géographiques, horaires d’ouverture et services proposés ;
Les prix et les informations figurant dans le système d’information;
Les ruptures de stock de carburants ;
Les fermetures définitives ou temporaires des points de vente.
Le flux de données instantané est mis à jour instantanément toutes les 10 minutes.

Source: https://donnees.roulez-eco.fr/opendata/instantane

Le prêt locatif à usage social (PLUS) permet de financer :
- l'achat de terrain et la construction de logements neufs ;
- l'acquisition et l’amélioration de logements anciens ;
- la transformation de locaux divers, avec ou sans acquisition, en logements locatifs. ...
